import react from "react";
import './TodoItem.css'
function TodoItem(props){


    return(
        <li className="TodoItem">
          <img className={`Icon Icon-check ${props.completed && 'Icon-check--active'}`}
             onClick={props.onComplete} alt="svgImg" src="data:image/svg+xml;base64,"/>

             <p className={`TodoItem-p ${props.completed && 'TodoItem-p--complete'}`}>{props.text}</p>
             <img className="Icon Icon-delete"
              onClick={props.onDelete} alt="svgImg" src="data:image/svg+xml;base64,"/>
           
        </li>
    );
}

export { TodoItem };
